import React from "react";

class Homepage extends React.Component {

  componentDidMount() {
    fetch("http://localhost:3000/profile")
      .then(res => res.json())
      .then(profileInfo => console.log(profileInfo));
  }

  render() {
    return <p>Hey Home</p>;
  }
}
export default Homepage;
